import React from "react";
import { MDBBtn, MDBIcon } from "mdb-react-ui-kit";

export default function Content(props) {
    let {imageurl,movieurl} = props;
  return (
    <div>
      <div class="container">
        <div class="row">
          <div class="items col-md">
            <div class="bg-image">
              <img src={imageurl} class="img-fluid" alt="Sample"/>
              <div class="mask">
                <div class="d-flex justify-content-center align-items-center h-100">
                  <a href={movieurl}>
                    <p class=" contenticon text-white mb-0">
                      <MDBIcon far icon="play-circle" />
                    </p>
                  </a>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}





